import { useState, useEffect } from 'react';
import axios from 'axios';
import { useSelector, useDispatch } from 'react-redux';
import { STORE, ADD, DELETE, INCREASE, DECREASE } from '../Reducers/cartReducer';
import { Data, FoodData, Discounts, Items } from '../Reducers/cartReducer';
import { cartReducer } from '../Reducers/cartReducer';
import { RootState } from '../Reducers';

export default function FoodList() {
  const [loading, setLoading] = useState<boolean>(false);
  const [data, setData] = useState<object>({});

  const { foodData } = useSelector(state => state.RootState.cartReducer)

  const dispatch = useDispatch();
  const onStore = (data: FoodData) => {
    dispatch(STORE(data));
  }

  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);
        const response = await axios.get("https://us-central1-react-baemin.cloudfunctions.net/merchantInfo");
        setData(response.data);
        console.log(response.data);
        // const temp = JSON.parse(response.data);
        onStore({...response.data});
      } catch (error) {
        console.log(error)
      }
      setLoading(false);
    }
    fetchData();
  },[]);

  return <div>test</div>;
}
